jQuery( document ).ready( function ( $ ) {
	$( 'img.img-responsive' ).hide();
	$( 'img.img-responsive' ).after( '<span class="loader-overlay"><img src="data:image/gif;base64," /></span>' );
	$( 'img.img-responsive' ).one( 'load', function() {
		$( this ).siblings( '.loader-overlay' ).fadeOut();
		$( this ).fadeIn();
	} ).each( function() {
		if( this.complete ) $( this ).load();
	} );

	$( '.mm_buy_now' ).each(function( i ) {
		var mm_href = $( this ).attr( 'href' );
		$( this ).removeAttr( 'href' );
		$( this ).data( 'checkout', mm_href );
	} );
	$( '.mm_buy_now' ).click( function ( item ) {
		item.preventDefault;
		$( this ).append( ' <img src="data:image/svg+xml;base64,"/>' );
		var data = {
			'action': 'mm_buy_now',
			'id': $( this ).data( 'id' ),
			'price': $( this ).data( 'price' )
		};
		var item = this;
		jQuery.post( ajaxurl, data, function( response ) {
			var order = JSON.parse( response );
			if ( order.status == 'success' ) {
				window.location = order.billing_response.redirectTo;
			} else {
				window.location = $( item ).data( 'checkout' );
			}
		} );
	} );
	$( '.dropdown-toggle').on( 'hover', function() {
		$( this ).parent().addClass( 'open' );
		$( this ).attr( 'aria-expanded', 'true' );
	} );
	$( 'body.mojo-admin-page #sort_select' ).change( function() {
		window.location.href = window.location.href + '&sort=' + this.value;
	} );
	$( 'body.mojo-admin-page  a.sort-direction' ).click( function( link ) {
		link.preventDefault();
		var dir = location.search.split( 'direction=' )[1];
		if ( 'undefined' == typeof( dir ) || 'asc' == dir ) {
			window.location.href = window.location.href + '&direction=desc';
		} else {
			window.location.href = window.location.href + '&direction=asc';
		}
	} );
} );
